import React from "react"
import styled from "styled-components"

const Footer = styled.footer`
	background: #273456;
	color: #fff;
`

const FooterComponent = () => {
	return (
		<Footer>
			&copy; {new Date("YYYY")}{" "}
			<a href="https://herper.io/">Jacob Herper</a>
		</Footer>
	)
}

export default FooterComponent
